<html>

<head>
    <title>Plantilla correo</title>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Questrial&display=swap');

        * {
            margin: 0;
            padding: 0;
            border: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Questrial', sans-serif;
        }

        @media screen and (max-width: 666px) {

            th,
            td {
                padding: 4px !important;
                font-size: 14px !important;
            }

            .title {
                font-size: 14px !important;
            }

            .warning {
                font-size: 8px !important;
            }
        }

        @media screen and (max-width: 480px) {
            .image {
                display: none;
            }

            img {
                display: none;
            }

            th,
            td {
                font-size: 10px !important;
            }

            .body-mail {
                padding: 20px 0;
            }

            button {
                font-size: 10px;
            }
        }
    </style>
</head>

<body style="font-family: system-ui, -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;">
    <div style="max-width: 800px; width: 100%; display: flex; justify-content: center;padding: 30px;">
        <div style="background-color: #1F7AC3; width:13%; border-top-left-radius: 20px; border-bottom-left-radius: 20px;">
        </div>
        <div class="body-mail" style="border-radius: 20px; border-top-left-radius: 0; border-bottom-left-radius: 0; border: solid 1px rgb(199, 196, 196); width: 70%;">
            <header style="margin: 20px 0;">
                <h1 class="title"
                    style="padding: 15px; text-align: justify; font-size: 16px; display: flex; flex-direction: column; font-weight: 400;">
                    Hola, est치s recibiendo este correo porque se ha creado una cuenta de usuario con Nickname:
                    <strong style="display: contents;">{{$nickname}}</strong>, para el acceso a E-franco por parte del administrador.
                </h1>
            </header>
            <div style="width: 80%; margin: auto; margin-top: 20px;">
                <h3 style="margin-bottom: 10px; font-weight: 300; font-size: 14px;">Las credenciales son:</h3>
                <table style="width: 100%; border-collapse: collapse;">
                    <thead>
                        <th style="padding: 8px; text-align: center; background-color: #1F7AC3; color: #fff;">Nickname
                        </th>
                        <th style="padding: 8px; background-color: #1F7AC3; color: #fff;">Contrase침a</th>
                    </thead>
                    <tbody>
                        <td style="padding: 8px; text-align: center; background-color: rgb(235, 235, 235);">{{$nickname}}</td>
                        <td style="padding: 8px; text-align: center; background-color: rgb(235, 235, 235);">{{$password}}</td>
                    </tbody>
                </table>
                <span class="warning" style=" font-size: 10px; margin: auto; display: flex; justify-content: center; margin: 10px 0;">
                    <strong style="text-align: center;">* Por seguridad una vez ingreses te recomendamos cambiar la
                        contrase침a *
                    </strong>
                </span>
                <div style="text-align: center; margin: 20px 0;">
                    <button style="background-color: #1F7AC3; color: white; padding: 5px 10px; border-radius: 6px; cursor: pointer; border: none;">
                        <a style="text-decoration: none; color: #fff;"
                            href="http://localhost:3000/welcome?code={{ $confirmation_code }}"> Cambiar contrase침a
                        </a>
                    </button>
                </div>
            </div>
            <div class="image" style="padding: 24px 10px; display: flex; justify-content: end;">
                <img src="data:image/png;base64,"
                    alt="" width="120px" height="120px">
            </div>
        </div>
    </div>
</body>

</html>
